import React, { Component } from 'react'
import { Text, View , TouchableOpacity , StyleSheet, ScrollView} from 'react-native'
import person from './components/person'
import First from './components/first'
import Login from './components/login'
 class App extends Component {
  constructor(props){
    super(props)

    this.state = {
      menu : ''
    }
  }

  menu1(){
    this.setState({
      menu : 'Menu 1'
    })
  }


  menu2(){
    this.setState({
      menu : 'Menu 2'
    })
  }

  menu3(){
    this.setState({
      menu : 'Menu 3'
    })
  }
  render() {
    return (
      <View>
        <person></person>
      </View>
    )
  }
}

const Styles = StyleSheet.create({

container : {
  paddingLeft : '50px' ,
  paddingRight : '50px' ,
  paddingTop : '30px' ,
  textAlign : 'center' ,
  fontSize : '20px' ,
  fontWeight : 'bold' 
} ,
underline : {
  marginTop : '30px' ,
  height : '2px' ,
  backgroundColor : 'black'
} ,
Content : {
  marginTop : '20px' ,
  display : 'flex' ,
  flexDirection : 'row' ,
  flexWrap : 'wrap' ,
  justifyContent : 'space-between' ,
  height : '80px' 
} ,

contentItem : {
  margin : '10px' ,

  textAlign : 'center' ,
  paddingTop : '15px' ,
  borderRadius : '15px' ,
  flexGrow : '1' ,
  shadowColor : '#000' ,
  shadowOffset : {
    width : 0 ,
    height : 2
  } ,
  shadowOpacity : 0.4 ,
  shadowRadius : 5,
  elevation : 8 
}
})

export default App
